[[package]]
name = "h11"
version = "0.12.0"
requires_python = ">=3.6"
summary = "A pure-Python, bring-your-own-I/O implementation of HTTP/1.1"

[[package]]
name = "httpcore"
version = "0.14.7"
requires_python = ">=3.6"
summary = "A minimal low-level HTTP client."
